import React, { Component } from 'react'
import Link from 'next/link'
import Layout from '../components/layout.js'

const linkStyle = {
  marginRight: 15
}

export default function Header2() {
  return (
      <Layout>
        <div>
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>About</a>
      </Link>
      </div>
      </Layout>
  )
}
